import React from "react";
import "./index.css";

export default function Chords() {
  // Example placeholder chords data
  const chords = [
    { name: "C Major", description: "Basic C Major chord." },
    { name: "D Major", description: "Basic D Major chord." },
    { name: "E Minor", description: "Basic E Minor chord." },
    { name: "G Major", description: "Basic G Major chord." },
    // Add more chords here
  ];

  return (
    <div className="chords-page">
      <h1 className="chords-title">Guitar Chords</h1>

      <section className="chords-section">
        {chords.map((chord, index) => (
          <div key={index} className="chord-card">
            <h2>{chord.name}</h2>
            <p>{chord.description}</p>
          </div>
        ))}
      </section>
    </div>
  );
}
